import React from "react";
import Home from "../component/home";
import Detail from "../component/poll_detail/index";
import Poll from "../redux/reducer/poll-reducer";

const router = [
  {
    path: "/",
    exact: true,
    main: () => <Home></Home>,
  },
  ,
  {
    path: "/poll",
    exact: false,
    main: () => <Poll></Poll>,
  },
  {
    path: "/polldetail/:id",
    exact: false,
    main: () => <Detail></Detail>,
  },
];

export default router;
